import { Typography } from "@material-ui/core"; // https://mui.com/api/typography/
import { useQuery, gql } from "@apollo/client";
import { loans } from "./useAPICall";

const query = gql`
  query myQuery {
    loans {
      id
      amount
      interestRate
      partnerId
    }
  }
`
// import useAPICall from "./useAPICall";
export default function App() {
  const foo = useQuery(query)
  console.log(foo);
  return (
    <div className="App">
      <h1>Welcome!</h1>
      <h2>Start editing to see some magic happen!</h2>
      <ul>
      {
        loans && loans.map((loan, ind) => {
          return <li>{loan.id}: ${loan.amount} ({loan.interestRate}%)</li>
        })
      }
      </ul>
    </div>
  );
}
